  <view class="img-full-screen">
    <navbar :isHome="false" />

    <image style="position: absolute; width: 120vw; height: 51vh; left: -10vw; top: -3vh;"
      src="data:image/svg+xml;base64,">
    </image>

    <image style="position: absolute; width: 50vw; height: 2vh; left: 13vw; top: 5.5vh;"
      src="data:image/svg+xml;base64,">
    </image>
    <image style="position: absolute; width: 70vw; height: 10vh; left: 3vw; top: 10vh;"
      src="data:image/svg+xml;base64,">
    </image>
    <image style="position: absolute; width: 55vw; height: 20vh; left: 3vw; top: 10vh;"
      src="data:image/svg+xml;base64,">
    </image>

    <image style="position: absolute; height: 16vh; width: 31vw; left: 7vw; top: 23vh;" :src="img_url">
    </image>

    <!-- 信号灯 -->
    <view @click="buttonOneClicked">
      <image style="position: absolute; width: 50vw; height: 40vh; left: 45vw; top: 20vh;"
        src="data:image/svg+xml;base64,">
      </image>
    </view>

    <view @click="buttonTwoClicked">
      <image style="position: absolute; width: 48vw; height: 38vh; left: 5vw; top: 35vh;"
        src="data:image/svg+xml;base64,">
      </image>
    </view>
    <image style="position: absolute; width: 40vw; height: 10vh; left: 5vw; top: 64vh;"
      src="data:image/svg+xml;base64,">
    </image>

    <view @click="buttonThreeClicked">
      <image style="position: absolute; width: 48vw; height: 38vh; left: 48vw; top: 50vh;"
        src="data:image/svg+xml;base64,">
      </image>
    </view>
    <image style="position: absolute; width: 40vw; height: 10vh; left: 55vw; top: 78vh;"
      src="data:image/svg+xml;base64,">
    </image>

    <view @click="buttonFourClicked">
      <image style="position: absolute; width: 63vw; height: 23vh; left: 7vw; top: 74vh;"
        src="data:image/svg+xml;base64,">
      </image>
